import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';

import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import img2 from '../src/img/IMG-20250327-WA0022.jpg';

class ResponsiveExample extends Component {
  render() {
    return (
      <Container fluid className='d-flex justify-content-center align-items-center'>
        <Row className="w-100">
          <Col xs={12} md={5} className="d-flex justify-content-center">
            <Card className='border-0 rounded-0 shadow-sm m-3' style={{ width: '22rem' }}>
              <Card.Img variant="top" className='rounded-0' src={img2} />
              <Card.Body className='m-3'>
                <Card.Title className='text-center text-capitalize'>Sandra Juma Dorbor</Card.Title>
                <Card.Text className='text-center text-capitalize'>
                  Executive Director - <span className='text-uppercase'>LISS</span>
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
          <Col xs={12} md={6}>
            <h1 className='m-3 text-capitalize text-center'>Meet Our Founder</h1>
            <p className="m-3">
              Gravida eligendi? Class ac dolorem sit mattis necessitatibus? Dui dolor consequat laboris interdum vulputate?
              Deleniti vero praesent quisquam risus curae est fames. Dolorum possimus, aliquam dolorem laudantium minus.
              Adipiscing quis, maecenas cubilia, est sapien. Malesuada sunt, consectetuer integer ullamcorper! Qui, voluptate
